apiVersion: apps.kubermatic.k8c.io/v1
kind: ApplicationDefinition
metadata:
  name: local-ai
spec:
  description: LocalAI is an open-source alternative to OpenAI’s API, designed to run AI models on your own hardware.
  displayName: LocalAI
  method: helm
  versions:
    - template:
        source:
          helm:
            chartName: local-ai
            chartVersion: 3.4.2
            url: oci://quay.io/kubermatic-mirror/helm-charts
      version: "2.23"
  defaultValuesBlock: |
    service:
      # To Expose local-ai externally without ingress, set service type as "LoadBalancer". Default value is "ClusterIP".
      type: "ClusterIP"
      port: 8080
    persistence:
      models:
        accessModes:
        - ReadWriteOnce
        annotations: {}
        enabled: true
        globalMount: /models
        size: 30Gi
      output:
        accessModes:
        - ReadWriteOnce
        annotations: {}
        enabled: true
        globalMount: /tmp/generated
        size: 30Gi
  documentationURL: https://localai.io/docs/overview/
  sourceURL: https://github.com/mudler/LocalAI
